def print_grid_traversal(graph, n, trav=[]):
    def index(r, c):
        return r*n + c
    
    m = len(graph) // n
    
    for i in range(m):
        for j in range(n):
            k = index(i, j)
            if k in trav:
                print("{0:0>3}".format(trav.index(k)), end='')
            else:
                print('***', end='')
            if j < n-1 and graph[k][index(i, j+1)] and graph[index(i, j+1)][k]:
                print('---', end='')
            elif j < n-1 and graph[k][index(i, j+1)]:
                print('-->', end='')
            elif j < n-1 and graph[index(i, j+1)][k]:
                print('<--', end='')
            else:
                print('   ', end='')
        print('\n', end='')
        if i < m - 1:
            for j in range(n):
                k = index(i, j)
                if j == 0:
                    print(' ', end='')
                if graph[k][index(i + 1, j)] and graph[index(i + 1, j)][k]:
                    print('|', end='')
                elif graph[k][index(i + 1, j)]:
                    print('\u21E3', end='')
                elif graph[index(i + 1, j)][k]:
                    print('\u21E1', end='')
                else:
                    print(' ', end='')
                if j < n-1:
                    print('     ', end='')
            print('\n', end='')


def grid_graph(m, n):
    
    def row_index(k):
        return k // n
    
    def col_index(k):
        return k % n
    
    def neighbors(i):
        res = []
        if col_index(i) > 0:
            res.append(i-1)
        if col_index(i) < n - 1:
            res.append(i+1)
        if row_index(i) > 0:
            res.append(i-n)
        if row_index(i) < m-1:
            res.append(i+n)
        return res
    
    graph = []
    for i in range(m*n):
        row = []
        nb = neighbors(i)
        for j in range(m*n):
            if j in nb:
                row.append(1)
            else:
                row.append(0)
        graph.append(row)
    
    return graph


def neighbours(v, graph):
    return [j for j in range(len(graph)) if graph[v][j]]


def empty_graph(n):
    return [n*[0] for i in range(n)]


def extension(c, g):
    """I: connect. vertices, graph
       O: extension edge (i, j)"""
    n = len(g)
    for i in c:
        for j in range(n):
            if j not in c and g[i][j]:
                return i, j


def spanning_tree(graph):
    """Input : adjacency matrix of graph
       Output: adj. mat. of spanning tree of graph"""
    n = len(graph)
    tree = empty_graph(n)
    conn = {0}
    while len(conn) < n:
        i, j = extension(conn, graph)
        tree[i][j] = 1
        tree[j][i] = 1
        conn.add(j)
    return tree


def rand_spanning_tree(graph):
    """Input : adjacency matrix of graph
        Output: adj. mat. of spanning tree of graph"""
    from random import randint
    n = len(graph)
    tree = empty_graph(n)
    conn = {randint(0, n-1)}
    while len(conn) < n:
        i, j = rand_extension(conn, graph)
        tree[i][j] = 1
        tree[j][i] = 1
        conn.add(j)
    return tree 


def rand_extension(c, g):
    """I: connect. vertices, graph
        O: extension edge (i, j)"""
    from random import shuffle
    n = len(g)
    i_cand = list(c)
    shuffle(i_cand)
    for i in i_cand:
        j_cand = list(range(n))
        shuffle(j_cand)
        for j in j_cand:
            if j not in c and g[i][j]:
                return i, j